import React from 'react';
import './App.css';
import Customer from './components/customer'

const customer={
  'id':1,
  'img':'https://placeimg.com/64/64/any',
  'name':'Thor',
  'birth':'950413',
  'gender':'male',
  'job':'son of odin'
}



function App() {
  return (
    <div >
      <Customer
      name = {customer.name}
      birth = {customer.birth}
      gender = {customer.gender}
      job={customer.job}
        />
    </div>
  );
}

export default App;
